import React from 'react';
import './nav.css';


function nav()
{

  return
  (

    <header>

        <nav class = "navigation">
            <ul>
              <li> <a href="rozklad.html">Расписание</a></li>
              <li> <a href="photo.html">Фотоальбом</a></li>
              <li> <a href="news.html">Последние новости</a></li>
            </ul>
        </nav>
        <div>
            <h1 class = "maintitle" >Личный блог Чузова Дмитрия</h1>
        </div>
    </header>


  );

}

export default nav;
